import { View, Text, StyleSheet } from "react-native";

const List = () => {
  return (
    <View style={styled.ListContainer}>
      <Text style={styled.ListText}>List</Text>
      <Text style={styled.ListText}>List</Text>
      <Text style={styled.ListText}>List</Text>
      <Text style={styled.ListText}>List</Text>
      <Text style={styled.ListText}>List</Text>
      <Text style={styled.ListText}>List</Text>
      <Text style={styled.ListText}>List</Text>
      <Text style={styled.ListText}>List</Text>
      <Text style={styled.ListText}>List</Text>
      <Text style={styled.ListText}>List</Text>
      <Text style={styled.ListText}>List</Text>

      <Text style={styled.ListText}>List</Text>
      <Text style={styled.ListText}>List</Text>
      <Text style={styled.ListText}>List</Text>
      <Text style={styled.ListText}>List</Text>
      <Text style={styled.ListText}>List</Text><Text style={styled.ListText}>List</Text><Text style={styled.ListText}>List</Text>
      <Text style={styled.ListText}>List</Text>
      <Text style={styled.ListText}>List</Text>
      <Text style={styled.ListText}>List</Text>
      <Text style={styled.ListText}>List</Text>

      <Text style={styled.ListText}>List</Text>
      <Text style={styled.ListText}>List</Text>
      <Text style={styled.ListText}>List</Text>
      <Text style={styled.ListText}>List</Text>
      <Text style={styled.ListText}>List</Text>

    </View>
  );
};

const styled = StyleSheet.create({
  ListContainer: {
    borderColor: "red",
    borderWidth: 1,
    width: "100%",
    height: "80%",
    overflow:'scroll'
  },
  ListText: {
    fontSize: 24,
    color: "black",
  },
});

export default List;
